  name: "SkyHub"
  code: "skyhub" 
  file-type: CSV 
  match-regex: >-
    ^\s*#Elapsed,Time,Pitch,Roll,Yaw,Latitude,Longitude,Altitude,RTK Status,ALT:Altitude,GPR:Trace$
  file-format:
    has-header: false
    comment-prefix: '#'
    decimal-separator: '.'
    separator: ','
    date-regex: '\d{4}-\d{2}-\d{2}'
  columns:
    latitude:
      index: 5
    longitude:
      index: 6
    timestamp: 
      index: 1
    trace-number:
      index: 10
